import React from "react";
import { ReactSVG } from "react-svg";
import libraryIcon from "../images/library.svg";

function Library() {
	return (
		<div className="library-container">
            <ReactSVG src={libraryIcon}></ReactSVG>
        </div>
	);
}

export default Library;
